function BarraPesquisa(){
    return(
        <div className="Barra Pesquisa">
            <input />
            <select defaultChecked> 
                <option>Livro</option>
                <option>Biblioteca</option>         
                <option>Genero</option>
            </select>
        </div>
    )
}
export default BarraPesquisa;
